Hi @Manan , thanks for reporting this, the issue here is that the datatokenBalance is 0. Also looks like you created the fixed rate exchange with the parameter 'withMint' `false` or was not set. 
`token": {
      "id": "0xb37dfb605d7c19927034ebfce20e1eb2ee816c47",
      "dispensers": [],
      "fixedRateExchanges": [
        {
          "id": "0x25e1926e3d57ec0651e89c654ab0fa182c6d5cf7-0xd804e318a8ce2eb8d02d845f23caf646a25313311a9c6a2ce1faca71476640fd",
          "exchangeId": "0xd804e318a8ce2eb8d02d845f23caf646a25313311a9c6a2ce1faca71476640fd",
          "withMint": null,
          "datatokenBalance": "0"
        }
      ]
    }`
Please set this to `true` if want to have to have the asset consumable from ocean market multiple times ğŸ˜ƒ .
You can set this in the fixed rate creation params interface https://github.com/oceanprotocol/ocean.js/blob/main/src/%40types/FixedPrice.ts#L10.
